import React, { Component } from "react";
import {   withRouter } from "react-router-dom";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";

import "./Sidenav.css";


class SideNav extends Component {
  onLogoutClick = e => {
    this.props.logoutUser(this.props.history);
    window.location.href = "/";
  };

 
  render() {
  
    const { user } = this.props.auth;
    return (
      <div id="sidebar-collapse" className="col-sm-3 col-lg-2 sidebar">
		<div className="profile-sidebar">
			<div className="profile-userpic">
				<img src="http://placehold.it/50/231D4E/fff" className="img-responsive" alt=""></img>
			</div>
			<div className="profile-usertitle">
				<div className="profile-usertitle-name">  <h6 style={{ fontFamily:  "Nexa Light"}}>
              <center><b>Hello Admin,</b> {user.name.split(" ")[0]}</center>
            </h6></div>
            
				<div className="profile-usertitle-status"><span className="indicator label-success"></span>Online</div>
			</div>
			<div className="clear"></div>
		</div>
		<div className="divider"></div>
		<form role="search">
			<div className="form-group">
				<input type="text" className="form-control" placeholder="Search"></input>
			</div>
		</form>
		<ul className="nav menu">
			<li className="active"><a href="/dashboard"><em className="fa fa-dashboard">&nbsp;</em> Dashboard</a></li>
			<li><a href="/home"><em className="fa fa-home">&nbsp;</em> Home</a></li>
			<li><a href="/investor"><em className="fa fa-line-chart">&nbsp;</em> Investor Relation</a></li>
			<li><a href="/members"><em className="fa fa-users">&nbsp;</em> Members</a></li>
			<li><a href="/downloadables"><em className="fa fa-download">&nbsp;</em> Downloadables</a></li>
			<li onClick={this.onLogoutClick}><a className="fa fa-power-off">&nbsp;</a> Logout</li>
		</ul>
	</div>
    );
  }
}
const mapStateToProps = state => ({
  projects: state.projects,
  auth: state.auth
});

export default withRouter(
  connect(
    mapStateToProps,
    { logoutUser }
  )(withRouter(SideNav))
);
